import React, {Component} from 'react';
import {Form} from "react-bootstrap";
import baseService from '../services/baseService'
import Table from "react-bootstrap/Table";
import 'react-confirm-alert/src/react-confirm-alert.css'; // Import css

class Visitors extends Component {
    state = {
        visitors: [],
        loading: true,

    };

    componentWillMount() {
        console.log('visitors will mount')
        baseService.getVisitors().then((visitors) => {
            console.log(visitors)
            this.setState({
                visitors,
                loading: false
            })
        }).catch((err) => console.log(err));
    }


    render() {
        return (
            <div>
                <h2>Visitors</h2>


                <Form>

                    <Table striped bordered hover>
                        <thead>
                        <tr>
                            <th>#</th>
                            <th>Brand</th>
                            <th>Carrier</th>
                            <th>DeviceId</th>
                            <th>ipAddress</th>
                            <th>uniqueId</th>
                            <th>isTablet</th>
                            <th>landscape</th>
                        </tr>
                        </thead>
                        <tbody>

                        {this.state.visitors.length > 0 ? this.state.visitors.map((visitor, index) => {
                            return (
                                <tr>
                                    <td>{index}</td>
                                    <td>{visitor.brand}</td>
                                    <td>{visitor.carrier}</td>
                                    <td>{visitor.deviceId}</td>
                                    <td>{visitor.ipAddress}</td>
                                    <td>{visitor.uniqueId}</td>
                                    <td>{visitor.isTablet}</td>
                                    <td>{visitor.landscape}</td>


                                </tr>
                            )
                        }) : <tr>
                            <td colSpan="8">
                                <center>No Visitors yet</center>
                            </td>
                        </tr>}

                        </tbody>
                    </Table>
                </Form>



            </div>
        );
    }
}

export default Visitors;
